/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Fragment } from 'react';
import Link from 'next/link';

const HeaderMenu = (props) => {
  const { menu } = props;
  return (
    <Fragment>
      <li>
        <Link href={`/${menu}`}>
          <a>
            {menu}
          </a>
        </Link>
      </li>
      <style jsx>
        {`
          ul{
            
          }
          li{
            display:inline;
            margin-left:50px;
            line-height:100px;
          }
        `}
      </style>
    </Fragment>
  );
};

export default HeaderMenu;
